import Header from '../components/Header';
import Links from '../components/InnerLinks/Links';
import SignUp from '../components/SignUp';
import Footer from '../components/Footer';
import innerLinksData from '../data/innerLinksData.json';

import Head from 'next/head';
import { PageTransition } from 'next-page-transitions';

function BeforeAfterPhoto(props) {
    return (
        <div>
            <Head>
                <link href="https://fonts.googleapis.com/css?family=Montserrat:300,400,500,600,700&display=swap" rel="stylesheet" /> 
                <link href="/static/style.css" rel="stylesheet" />
            </Head>
            <style jsx global>{`
          .page-transition-enter {
            opacity: 0;
          }
          .page-transition-enter-active {
            opacity: 1;
            transition: opacity 300ms;
          }
          .page-transition-exit {
            opacity: 1;
          }
          .page-transition-exit-active {
            opacity: 0;
            transition: opacity 300ms;
          }
        `}</style>
        <PageTransition timeout={300} classNames="page-transition">
        <div className="wrapper">
                <div>
                    <Header />
                    <Links innerObj={props.onlineObj}/>
                    <SignUp />
                    <Footer />
                </div>
            </div>
        </PageTransition>
            
        </div>
    )
}
  
export async function getStaticProps({}) {
    let onlineObj = innerLinksData.beforeafterpics;
    return {
        props: {
            onlineObj,
        },
    }
}


export default BeforeAfterPhoto;
